function InitScanCodes(){
    sendPacketString("00 07 05 08 00 01",65);
    savedLayout = layout;
    device.log(`Setting layout to ${savedLayout}`)
    var ScanCodes = []
    for(var ScanCode = 0; ScanCode < 120 + LayoutDict[layout].length && ScanCode < 0x84; ScanCode++){
        if(LayoutDict[layout].includes(ScanCode)){
            continue;
        }
        ScanCodes.push(ScanCode);
        ScanCodes.push(0xC0);
    }
    for(var packetCount = 0; packetCount < 4; packetCount++) {
        var packet = []
        packet[0] = 0x00;
        packet[1] = 0x07;
        packet[2] = 0x40;
        packet[3] = packetCount == 3 ? 0x19 : 0x1E;
        packet[4] = 0x00;
        packet = packet.concat(ScanCodes.splice(0,60))
        device.write(packet,65);
    }
}


export function Shutdown()
{
    sendPacketString("00 07 04 01",65)
    sendPacketString("00 07 05 01 00 03",65) 
}


function StreamPacket(packet_id, data_sz, data)
{
    var packet = [];


    packet[0x00]   = 0x00;
    packet[0x01]   = COMMAND_STREAM;
    packet[0x02]   = packet_id;
    packet[0x03]   = data_sz;
    packet[0x04]   = 0;

    packet = packet.concat(data);

    device.write(packet, 65);
}


function SubmitKbColors(color_channel, packet_count, finish_val)
{
    var packet = [];

  
    packet[0x00]   = 0x00;
    packet[0x01]   = COMMAND_WRITE;
    packet[0x02]   = COMMAND_SUBMIT;
    packet[0x03]   = color_channel;
    packet[0x04]   = packet_count;
    packet[0x05]   = finish_val;

 
    device.write(packet, 65);
}



